英语:
You have fully understood and agreed to bear the relevant risks associated with the grey market trading of new issue, including (but not limited to) the followings:

1. New listing and issue may be cancelled or postponed;

2. The market price of the grey market may be largely different from the price upon listing;

3. The liquidity of the grey market is lower than that during regular market time of the Stock Exchange, and your orders may not be fully executed;

