简体:
阁下已经清楚了解并同意承担新股暗盘交易的相关风险，包括（但不限于）以下：

1. 新股有可能会被取消或延期上市;

2. 暗盘的行情有可能与上市时的价格差异较大;

3. 暗盘交易的流通性相比联交所正规市场时间较低，阁下的指示可能无法完全执行;

4. 盈立证券不会对有关暗盘交易作出保证绝对成交。

繁体:
閣下已經清楚了解並同意承擔新股暗盤交易的相關風險，包括（但不限於）以下：

1. 新股有可能會被取消或延期上市;

2. 暗盤的行情有可能與上市時的價格差異較大;

3. 暗盤交易的流通性相比聯交所正規市場時間較低，閣下的指示可能無法完全執行;

4. 盈立證券不會對有關暗盤交易作出保證絕對成交。

马来语:
Anda telah memahami sepenuhnya dan bersetuju untuk memikul risiko berkaitan yang berkaitan dengan                                                                                                                                                                                                             yang berikut Penyenaraian dan isu baharu mungkin dibatalkan atau ditunda;

2. Harga pasaran pasaran kelabu mungkin sangat berbeza daripada harga semasa penyenaraian;

