4. uSMART Securities Limited tidak akan menjamin pelaksanaan mutlak dagang pasaran kelabu

简体:
BOLL指标是根据统计学中的标准差原理设计出来的一种非常简单实用的技术分析指标。一般而言，股价的运动总是围绕某一价值中枢(如均线、成本线等)在一定的范围内变动，布林线指标指标正是在上述条件的基础上，引进了“股价通道”的概念，其认为股价通道的宽窄随着股价波动幅度的大小而变化，而且股价通道又具有变异性，它会随着股价的变化而自动调整。正是由于它具有灵活性、直观性和趋势性的特点，BOLL指标渐渐成为投资者广为应用的市场上热门指标。

一般认为，BOLL指标有三大功能:
1、指示支撑和阻力作用;
2、显示超买和超卖;
3、显示整体趋势。

繁体:
BOLL指標是根據統計學中的標準差原理設計出來的一種非常簡單實用的技術分析指標。 一般而言，股價的運動總是圍繞某一價值中樞(如均線、成本線等)在- -定的範圍內變動，布林線指標指標正是在上述條件的基礎上，引進了“股價通道”的概念，其認為股價通道的寬窄隨著股價波動幅度的大小而變化， 而且股價通道又具有變異性，它會隨著股價的變化而自動調整。 正是由於它具有靈活性、直觀性和趨勢性的特點，BOLL指標漸漸成為投資者廣為應用的市場上熱門指標。

一般認為，BOLL指標有三大功能:
1、指示支撐和阻力作用;
2、顯示超買和超賣;
3、顯示整體趨勢。

英语:
1. Securities include A shares, excluding preferred stocks, funds, bonds; 
2. pledge quantity is calculated as off-site pledge registration and Stock pledged repo ; 
3. pledge proportion calculation formula is: (quantity of off-site pledge registered + quantity of stock pledged repo transactions) / total share capital of all A-shares ; 
4. Data is based on the last trading day of the week. 
    Data Source: CSDC, update on the last trading day of the week.

简体:
①证券范围包括Ａ股股票，不含优先股、基金、债券;
②质押数量的计算范围为“场外质押登记（含柜台质押登记、私募可交换债发行中涉及的预备换股股票质押登记，下同）、股票质押式回购交易”;
③质押比例计算公式为：（场外质押登记股数+股票质押式回购交易数量）/上市公司A股总股本;
④价格显示日期为计算质押比例的每周最后一个交易日日期。
    数据来自中登结，每周最后一个交易日公布。

繁体:
①證券範圍包括Ａ股股票，不含優先股、基金、債券;
②質押數量的計算範圍爲“場外質押登記（含櫃台質押登記、私募可交換債發行中涉及的預備換股股票質押登記，下同）、股票質押式回購交易”;
③質押比例計算公式爲：（場外質押登記股數+股票質押式回購交易數量）/上市公司A股總股本;
④價格顯示日期爲計算質押比例的每周最後一個交易日日期。
    數據來自中登結，每周最後一個交易日公布。

马来语:
1. Sekuriti termasuk saham A, tidak termasuk saham opysyen, dana, bon; 
2. kuantiti cagar dikira sebagai pendaftaran cagar di luar laman dan repo cagar saham ; 
3. formula pengiraan perkadaran ikrar ialah: (kuantiti ikrar luar laman didaftarkan + kuantiti transaksi repo dicagarkan saham) / jumlah modal saham semua saham-A ; 
4. Data adalah berdasarkan pada hari perdagangan terakhir dalam minggu. 
    Sumber Data: Perkhidmatan PelangganDC, kemas kini pada  hari perdagangan terakhir dalam satu minggu .

英语:
Value Status:
Undervalued ​(a good deal!):Price to Fair Value ratio is less than 1.0;
Near Fair Value​ (at least it's a fair price):Price to Fair Value ratio is between 1.0 and 2.0;
Overvalued ​(trading at a premium):Price to Fair Value ratio is greater than 2.0;

Rate of Return(Estimate):
Our Rate of Return Estimate represents the projected average annual return you might expect after purchasing shares in the company and holding them over the default time horizon of 5 years, based on the EPS growth rate that we have projected.

1 Securities include A shares, excluding preferred stocks, funds, bonds; 
2 pledge quantity is calculated as off-site pledge registration and Stock pledged repo ; 
3 pledge proportion calculation formula is: (quantity of off-site pledge registered + quantity of stock pledged repo transactions) / total share capital of all A-shares ; 
4 Data is based on the last trading day of the week. Data Source: CSDC, update on the last trading day of the week.

马来语:
